import { Component } from '@angular/core';
import { ActionSheetController, ToastController } from '@ionic/angular';
import { Food } from 'src/app/interfaces/food.interface';

@Component({
  selector: 'app-examen',
  templateUrl: './examen.page.html',
  styleUrls: ['./examen.page.scss'],
})
export class ExamenPage {

  Comida: Food[] = [
    {
      title: 'Pizza',
      description: 'Pizza de peperoni',
      price: 100,
      status: false,
      img: 'data:image/jpeg;base64,'
    },
    {
      title: 'Hamburguesa',
      description: 'Hamburguesa con queso',
      price: 80,
      status: false,
      img: 'data:image/jpeg;base64,'
    },
    {
      title: 'Hot Dog',
      description: 'Hot Dog con queso',
      price: 50,
      status: true,
      img: 'data:image/jpeg;base64,'
    },
    {
      title: 'Tacos',
      description: 'Tacos de pastor',
      price: 30,
      status: true,
      img: 'data:image/jpeg;base64,'
    },
    {
      title: 'Sushi',
      description: 'Sushi de salmon',
      price: 200,
      status: true,
      img: 'data:image/jpeg;base64,'
    },
    {
      title: 'Ensalada',
      description: 'Ensalada de pollo',
      price: 70,
      status: true,
      img: 'data:image/jpeg;base64,'
    },
    {
      title: 'Pasta',
      description: 'Pasta con salsa de tomate',
      price: 60,
      status: true,
      img: 'data:image/jpeg;base64,'
    },
    {
      title: 'Sopa',
      description: 'Sopa de fideos',
      price: 40,
      status: true,
      img: 'data:image/jpeg;base64,'
    },
    {
      title: 'Torta',
      description: 'Torta de jamon',
      price: 90,
      status: true,
      img: 'data:image/jpeg;base64,'
    }
  ];

  constructor( 
    private actionSheetCtrl: ActionSheetController,
    private toastCtrl: ToastController
    ) { }

  async openActionSheet(item: Food) {
    const actionSheet = await this.actionSheetCtrl.create({
      header: item.title,
      subHeader: 'Selecciona una opcion',
      buttons: [ {
        text: 'Favorito',
        icon: 'heart',
      }, {
        text: 'Carrito',
        icon: 'cart',
        handler: () => {
          this.addToCart(item);
        }
      }, {
        text: 'Cancel',
        icon: 'close',
        role: 'cancel',
        handler: () => {
          console.log('Cancel clicked');
        }
      }]
    });

    await actionSheet.present();
  }

  async addToCart(item: Food) {
    const toast = await this.toastCtrl.create({
      message: `${item.title} agregado al carrito`,
      duration: 2000
    });
    toast.present();
  }
}
